window.bookSummaryJSON = "<p>The first full-length dramatized audiobook in Martha Wells' New York Times and USA Today bestselling Murderbot Diaries series.</p> <p>You know that feeling when you’re at work, and you’ve had enough of people, and then the boss walks in with yet another job that needs to be done right this second or the world will end, but all you want to do is go home and binge your favorite shows? And you're a sentient murder machine programmed for destruction? Congratulations, you're Murderbot.</p> <p>Come for the pew-pew space battles, stay for the most relatable A.I. you’ll hear this century.</p> <p>I’m usually alone in my head, and that’s where 90 plus percent of my problems are.</p> <p>When Murderbot's human associates (not friends, never friends) are captured and another not-friend from its past requires urgent assistance, Murderbot must choose between inertia and drastic action.</p> <p>Drastic action it is, then.</p> <p>Performed by David Cui Cui, Crystal Lee, Elena Anderson, Natalie Van Sistine, Alejandro Ruiz, Amanda Forstrom, Christopher Williams, Colleen Delany, Debi Tinsley, Emily Beresford, Eva Wilhelm, Gabriel Michael, Gail Shalan, Holly Adams, Ken Jackson, Khaya Fraites, Laura C. Harris, Lise Bruneau, Lydia Kraniotis, Marni Penning, Nick Russo, Samantha Cooper, Sarah Ruth Thomas, Scott McCormick, Shanta Parasuraman, Thomas Penny, Triya Leong, Tyler Hyrchuk, Yasmin Tuazon and Zeke Alton.</p>"; 
